/* eslint-disable no-nested-ternary */
/**
 * @typedef {Array|Float32Array|Float64Array|number} complex
 */
/**
 * @ignore
 */
const {
  sqrt: msqrt, max, ceil: mceil,
  floor: mfloor, abs: mabs, exp: mexp, log10: mlog10,
  log: mlog, cos: mcos, sin: msin, tan: mtan,
  asin: masin, acos: macos, atan: matan, atan2: matan2,
  cosh: mcosh, sinh: msinh, tanh: mtanh, sign: msign,
} = Math;
/**
 * @ignore
 */
const masinh = x => mlog(x + msqrt(x * x + 1));
/**
 * @ignore
 */
const macosh = x => mlog(x + msqrt(x * x - 1));
/**
 * @ignore
 */
const matanh = x => mlog((1 + x) / (1 - x)) / 2;
/**
 * @ignore
 */
const BASE_10 = [mlog(10), 0];
/**
 * The value 2 in complex form
 */
export const TWO = Object.freeze([2, 0]);
/**
 * The value 1 in complex form
 */
export const ONE = Object.freeze([1, 0]);
/**
 * The value 0 in complex form
 */
export const ZERO = Object.freeze([0, 0]);
/**
 * The square root of -1
 */
export const I = Object.freeze([0, 1]);
/**
 * The square root of -1
 */
export const HALF_I = Object.freeze([0, 0.5]);
/**
 * The negative square root of -1
 */
export const NI = Object.freeze([0, -1]);
/**
 * A NaN complex
 */
export const NAN = Object.freeze([NaN, NaN]);
/**
 * @ignore
 */
const EPSILON = 1e-7;
/**
 * @ignore
 */
const eq = (a, b) => mabs(a - b) <= EPSILON * max(1, mabs(a), mabs(b));
/**
 * @ignore
 */
const isNumber = x => typeof x === 'number';
/**
 * @ignore
 */
const unsafeL2 = c => c[0] * c[0] + c[1] * c[1];
/**
 * @ignore
 */
const unsafeAbs = c => msqrt(unsafeL2(c));
/**
 * @ignore
 */
const unsafeArg = c => matan2(c[1], c[0]);
/**
 * @ignore
 */
const unsafeAdd = (a, b) => [a[0] + b[0], a[1] + b[1]];
/**
 * @ignore
 */
const unsafeSub = (a, b) => [a[0] - b[0], a[1] - b[1]];
/**
 * @ignore
 */
const unsafeMul = (a, b) => [
  a[0] * b[0] - a[1] * b[1],
  a[0] * b[1] + a[1] * b[0],
];
/**
 * @ignore
 */
const unsafeDiv = (a, b) => [
  (a[0] * b[0] + a[1] * b[1]) / unsafeL2(b),
  (a[1] * b[0] - a[0] * b[1]) / unsafeL2(b),
];
/**
 * @ignore
 */
const unsafeSqrt = c => [
  msqrt((c[0] + unsafeAbs(c)) / 2),
  msqrt((-c[0] + unsafeAbs(c)) / 2) * msign(c[1]),
];
/**
 * @ignore
 */
const unsafeLn = c => [
  mlog(unsafeAbs(c)),
  unsafeArg(c),
];
/**
 * @ignore
 */
const unsafeExp = c => [
  mexp(c[0]) * mcos(c[1]),
  mexp(c[0]) * msin(c[1]),
];
/**
 * @ignore
 */
const unsafeCos = c => [mcos(c[0]) * mcosh(c[1]), -msin(c[0]) * msinh(c[1])];
/**
 * @ignore
 */
const unsafeSin = c => [msin(c[0]) * mcosh(c[1]), mcos(c[0]) * msinh(c[1])];
/**
 * @ignore
 */
const unsafeCosh = c => [mcosh(c[0]) * mcos(c[1]), msinh(c[0]) * msin(c[1])];
/**
 * @ignore
 */
const unsafeSinh = c => [msinh(c[0]) * mcos(c[1]), mcosh(c[0]) * msin(c[1])];
/**
 * @ignore
 */
const unsafeAsin = c => unsafeMul(
  NI,
  unsafeLn(
    unsafeAdd(
      unsafeMul(I, c),
      unsafeSqrt(unsafeSub(ONE, unsafeMul(c, c))),
    ),
  ),
);
/**
 * @ignore
 */
const unsafeAcos = c => unsafeMul(
  NI,
  unsafeLn(
    unsafeAdd(
      c,
      unsafeSqrt(unsafeSub(unsafeMul(c, c), ONE)),
    ),
  ),
);
/**
 * @ignore
 */
const unsafeAtan = c => unsafeMul(
  HALF_I,
  unsafeLn(
    unsafeDiv(
      [c[0], 1 + c[1]],
      [-c[0], 1 - c[1]],
    ),
  ),
);
/**
 * @ignore
 */
const unsafeAsinh = (c) => {
  const r = unsafeMul(c, c);
  r[0] += 1;
  return unsafeLn(unsafeAdd(c, unsafeSqrt(r)));
};
/**
 * @ignore
 */
const unsafeAcosh = (c) => {
  const r = unsafeMul(c, c);
  r[0] -= 1;
  return unsafeLn(unsafeAdd(c, unsafeSqrt(r)));
};
/**
 * @ignore
 */
const unsafeAtanh = c => unsafeMul(
  unsafeLn(unsafeDiv(
    unsafeAdd(ONE, c),
    unsafeSub(ONE, c),
  )),
  [0.5, 0],
);
/**
 * Checks if a value is a valid complex value.
 */
export const isComplex = x => (x instanceof Array && isNumber(x[0]) && isNumber(x[1]))
  || x instanceof Float32Array
  || x instanceof Float64Array;
/**
 * Creates a zero complex value (different from ZERO)
 */
export const zero = () => [0, 0];
/**
 * Solves the conjugate of a given complex
 * @param {!complex} c
 * @returns {complex}
 * Returns NaN complex if the given value is not a complex.
 */
export const conjugate = c => (
  (isComplex(c) && [c[0], -c[1]])
  || (isNumber(c) && [c, 0])
  || NAN
);
/**
 * Negates the given complex
 * @param {!complex} c
 * @returns {complex}
 * Returns NaN complex if the given value is not a complex.
 */
export const negate = c => (
  (isComplex(c) && [-c[0], -c[1]])
  || (isNumber(c) && [-c, 0])
  || NAN
);

/**
 * Adds two complex
 * @param {!complex} a
 * @param {!complex} b
 * Returns NaN complex if one of the given values is not a complex.
 */
export const add = (a, b) => (
  (isComplex(a) && (
    (isComplex(b) && unsafeAdd(a, b))
    || (isNumber(b) && [a[0] + b, a[1]])
  ))
  || (isNumber(a) && (
    (isComplex(b) && [a + b[0], b[1]])
    || (isNumber(b) && [a + b, 0])
  ))
  || NAN
);

/**
 * Subtracts two complex
 * @param {!complex} a
 * @param {!complex} b
 * Returns NaN complex if one of the given values is not a complex.
 */
export const sub = (a, b) => (
  (isComplex(a) && (
    (isComplex(b) && unsafeSub(a, b))
    || (isNumber(b) && [a[0] - b, a[1]])
  ))
  || (isNumber(a) && (
    (isComplex(b) && [a - b[0], b[1]])
    || (isNumber(b) && [a - b, 0])
  ))
  || NAN
);

/**
 * Multiplies two complex
 * @param {!complex} a
 * @param {!complex} b
 * Returns NaN complex if one of the given values is not a complex.
 */
export const mul = (a, b) => (
  (isComplex(a) && (
    (isComplex(b) && unsafeMul(a, b))
    || (isNumber(b) && [a[0] * b, a[1] * b])
  ))
  || (isNumber(a) && (
    (isComplex(b) && [a * b[0], a * b[1]])
    || (isNumber(b) && [a * b, 0])
  ))
  || NAN
);

/**
 * Divides two complex
 * @param {!complex} a
 * @param {!complex} b
 * Returns NaN complex if one of the given values is not a complex.
 */
export const div = (a, b) => (
  (isComplex(a) && (
    (isComplex(b) && unsafeDiv(a, b))
    || (isNumber(b) && [a[0] / b, a[1] / b])
  ))
  || (isNumber(a) && (
    (isComplex(b) && [a / b[0], a / b[1]])
    || (isNumber(b) && [a * b, 0])
  ))
  || NAN
);

/**
 * Returns the reciprocal of a complex
 * @param {!complex} c
 * Returns NaN complex if the given value is not a complex.
 */
export const reciprocal = c => (isComplex(c)
  && [
    c[0] / unsafeL2(c),
    -c[1] / unsafeL2(c),
  ])
  || (isNumber(c) && [1 / c, 0])
  || NAN;
/**
 * Returns the modulus/magnitude of the complex
 * @param {!complex} c
 * @returns {number}
 * Returns NaN if the value is not a valid complex
 */
export const abs = c => (
  (isComplex(c) && unsafeAbs(c))
  || (isNumber(c) ? c : NaN)
);

/**
 * Returns the argument of a complex
 * @param {!complex} c
 * @returns {number}
 * Returns NaN if the value is not a valid complex.
 */
export const arg = c => (
  (isComplex(c) && unsafeArg(c))
  || (isNumber(c) ? 0 : NaN)
);

/**
 * Converts a radian value into a complex number.
 * @param {!number} x
 * @returns {complex}
 * Returns NaN if the value is not a number.
 */
export const euler = x => (
  (isNumber(x) && [mcos(x), msin(x)])
  || NAN
);

/**
 * Calculates the signum of a complex
 * @param {!complex} c
 * @returns {complex}
 * Returns NaN complex if the given value is not a complex.
 */
export const sign = c => (
  (isComplex(c) && [c[0] / unsafeAbs(c), c[1] / unsafeAbs(c)])
  || (isNumber(c) && [msign(c), 0])
  || NAN
);

/**
 * Calculates the square root of a complex
 * @param {!complex} c
 * @returns {complex}
 * Returns NaN complex if the given value is not a complex.
 */
export const sqrt = c => (
  (isComplex(c) && (
    (eq(c[1], 0) && [msqrt(c[0]), 0])
    || unsafeSqrt(c)
  ))
  || (isNumber(c) && [msqrt(c), 0])
  || NAN
);

/**
 * Calculates the exponentiation of a complex
 * @param {!complex} c
 * @returns {complex}
 * Returns NaN complex if the given value is not a complex.
 */
export const exp = c => (
  (isComplex(c) && unsafeExp(c))
  || (isNumber(c) && [mexp(c), 0])
  || NAN
);

/**
 * Calculates the natural logarithm of a complex
 * @param {!complex} c
 * @returns {complex}
 * Returns NaN complex if the given value is not a complex.
 */
export const ln = c => (
  (isComplex(c) && unsafeLn(c))
  || (isNumber(c) && [mlog(c), 0])
  || NAN
);

/**
 * Calculates the base 10 logarithm of a complex
 * @param {!complex} c
 * @returns {complex}
 * Returns NaN complex if the given value is not a complex.
 */
export const log10 = c => (
  (isComplex(c) && unsafeDiv(unsafeLn(c), BASE_10))
  || (isNumber(c) && [mlog10(c), 0])
  || NAN
);

/**
 * Raises the complex to the n-th complex power
 * @param {!complex} a
 * @param {!complex} b
 * @returns {complex}
 * Returns NaN complex if one of the given values is not a complex.
 */
export const pow = (a, b) => (
  (isComplex(a) && isComplex(b) && unsafeExp(unsafeMul(unsafeLn(a), b)))
  || (isNumber(a) && pow([a, 0], b))
  || (isNumber(b) && pow(a, [b, 0]))
  || NAN
);

/**
 * Applies a floor function to a complex
 * @param {!complex} c
 * @returns {complex}
 * Returns NaN complex if the given value is not a complex.
 */
export const floor = c => (
  (isComplex(c) && [mfloor(c[0]), mfloor(c[1])])
  || (isNumber(c) && [mfloor(c), 0])
  || NAN
);

/**
 * Applies a ceiling function to a complex
 * @param {!complex} c
 * @returns {complex}
 * Returns NaN complex if the given value is not a complex.
 */
export const ceil = c => (
  (isComplex(c) && [mceil(c[0]), mceil(c[1])])
  || (isNumber(c) && [mceil(c), 0])
  || NAN
);

/**
 * Converts polar coordinates into a complex
 * @param {!number} radius
 * @param {!number} phi
 * @returns {complex}
 * Returns NaN complex if the given value is not a complex.
 */
export const polar = (radius, phi) => (
  (isNumber(radius) && isNumber(phi) && [radius * mcos(phi), radius * msin(phi)])
  || NAN
);

/**
 * Applies a sine function to a complex
 * @param {!complex} c
 * @returns {complex}
 * Returns NaN complex if the given value is not a complex.
 */
export const sin = c => (
  (isComplex(c) && unsafeSin(c))
  || (isNumber(c) && [msin(c), 0])
  || NAN
);

/**
 * Applies a cosine function to a complex
 * @param {!complex} c
 * @returns {complex}
 * Returns NaN complex if the given value is not a complex.
 */
export const cos = c => (
  (isComplex(c) && unsafeCos(c))
  || (isNumber(c) && [mcos(c), 0])
  || NAN
);

/**
 * Applies a tangent function to a complex
 * @param {!complex} c
 * @returns {complex}
 * Returns NaN complex if the given value is not a complex.
 */
export const tan = c => (
  (isComplex(c) && unsafeDiv(unsafeSin(c), unsafeCos(c)))
  || (isNumber(c) && [mtan(c), 0])
  || NAN
);

/**
 * Applies a inverse sine function to a complex
 * @param {!complex} c
 * @returns {complex}
 * Returns NaN complex if the given value is not a complex.
 */
export const asin = c => (
  (isComplex(c) && unsafeAsin(c))
  || (isNumber(c) && [masin(c), 0])
  || NAN
);

/**
 * Applies a inverse cosine function to a complex
 * @param {!complex} c
 * @returns {complex}
 * Returns NaN complex if the given value is not a complex.
 */
export const acos = c => (
  (isComplex(c) && unsafeAcos(c))
  || (isNumber(c) && [macos(c), 0])
  || NAN
);

/**
 * Applies a inverse tangent function to a complex
 * @param {!complex} c
 * @returns {complex}
 * Returns NaN complex if the given value is not a complex.
 */
export const atan = c => (
  (isComplex(c) && unsafeAtan(c))
  || (isNumber(c) && [matan(c), 0])
  || NAN
);

/**
 * Applies a hyperbolic sine function to a complex
 * @param {!complex} c
 * @returns {complex}
 * Returns NaN complex if the given value is not a complex.
 */
export const sinh = c => (
  (isComplex(c) && unsafeSinh(c))
  || (isNumber(c) && [msinh(c), 0])
  || NAN
);

/**
 * Applies a hyperbolic cosine function to a complex
 * @param {!complex} c
 * @returns {complex}
 * Returns NaN complex if the given value is not a complex.
 */
export const cosh = c => (
  (isComplex(c) && unsafeCosh(c))
  || (isNumber(c) && [mcosh(c), 0])
  || NAN
);

/**
 * Applies a hyperbolic tangent function to a complex
 * @param {!complex} c
 * @returns {complex}
 * Returns NaN complex if the given value is not a complex.
 */
export const tanh = c => (
  (isComplex(c) && unsafeDiv(unsafeSinh(c), unsafeCosh(c)))
  || (isNumber(c) && [mtanh(c), 0])
  || NAN
);

/**
 * Applies a hyperbolic inverse sine function to a complex
 * @param {!complex} c
 * @returns {complex}
 * Returns NaN complex if the given value is not a complex.
 */
export const asinh = c => (
  (isComplex(c) && unsafeAsinh(c))
  || (isNumber(c) && [masinh(c), 0])
  || NAN
);

/**
 * Applies a hyperbolic inverse cosine function to a complex
 * @param {!complex} c
 * @returns {complex}
 * Returns NaN complex if the given value is not a complex.
 */
export const acosh = c => (
  (isComplex(c) && unsafeAcosh(c))
  || (isNumber(c) && [macosh(c), 0])
  || NAN
);

/**
 * Applies a hyperbolic inverse tangent function to a complex
 * @param {!complex} c
 * @returns {complex}
 * Returns NaN complex if the given value is not a complex.
 */
export const atanh = c => (
  (isComplex(c) && unsafeAtanh(c))
  || (isNumber(c) && [matanh(c), 0])
  || NAN
);

/**
 * Check if two complex are equal
 * @param {!complex} a
 * @param {!complex} b
 * @returns {boolean}
 */
export const equals = (a, b) => (
  (isComplex(a) && isComplex(b) && eq(a[0], b[0]) && eq(a[1], b[1]))
  || a === b
);

/* eslint-disable no-restricted-globals */
/* eslint-disable no-undef */
import assert from 'assert';
import {
  conjugate, I, NAN, zero,
  negate, ONE, NI, abs,
  acos, equals, acosh, asinh,
  asin, atan, atanh, tanh,
  tan, sinh, sin, cos,
  cosh, ceil, floor, exp,
  ln, log10, sqrt, euler,
  polar, sign, add, div,
  mul,
  pow,
  sub,
  reciprocal,
  arg,
} from '../src';

describe('fast-complex', () => {
  /**
   *
   */
  describe('abs', () => {
    it('should return a number', () => {
      assert(typeof abs([1, 0]) === 'number');
    });
    it('should return the vector length of the complex', () => {
      assert(abs([1, 0]) === 1);
    });
    it('should return the same value if the given value is a number', () => {
      assert(abs(1) === 1);
    });
    it('should return NaN if the given value is not a complex.', () => {
      assert(isNaN(abs()));
    });
  });
  /**
   *
   */
  describe('acos', () => {
    it('should return an Array', () => {
      assert(acos([1, 0]) instanceof Array);
    });
    it('should return the inverse cosine of the complex', () => {
      assert(equals(acos([1, 1]), [0.9045568943023813, -1.0612750619050355]));
    });
    it('should return the inverse cosine complex of the given number', () => {
      assert(equals(acos(1), [Math.acos(1), 0]));
    });
    it('should return NaN Complex if the given value is not a complex.', () => {
      assert(NAN === acos());
    });
  });
  /**
   *
   */
  describe('acosh', () => {
    it('should return an Array', () => {
      assert(acosh([1, 0]) instanceof Array);
    });
    it('should return the hyperbolic inverse cosine of the complex', () => {
      assert(equals(acosh([1, 1]), [1.0612750619050355, 0.9045568943023813]));
    });
    it('should return the hyperbolic inverse cosine complex of the given number', () => {
      assert(equals(acosh(1), [Math.acosh(1), 0]));
    });
    it('should return NaN Complex if the given value is not a complex.', () => {
      assert(NAN === acosh());
    });
  });
  /**
   *
   */
  describe('add', () => {
    it('should return an Array', () => {
      assert(add([1, 1], [1, 1]) instanceof Array);
    });
    it('should return the sum of two complex', () => {
      assert.deepEqual(add([1, 1], [1, 1]), [2, 2]);
    });
    it('should return the sum of a complex and a number', () => {
      assert.deepEqual(add([1, 1], 1), [2, 1]);
    });
    it('should return the sum of a number and a complex', () => {
      assert.deepEqual(add(1, [1, 1]), [2, 1]);
    });
    it('should return the sum of a number and a number', () => {
      assert.deepEqual(add(1, 1), [2, 0]);
    });
    it('should return NaN Complex if the given value is not a complex.', () => {
      assert(NAN === add());
    });
  });
  /**
   *
   */
  describe('arg', () => {
    const eq = (a, b) => Math.abs(a - b) <= 1e7 * Math.max(1, Math.abs(a), Math.abs(b));
    it('should return a number', () => {
      assert(typeof arg([1, 0]) === 'number');
    });
    it('should return the angle of the complex', () => {
      assert(eq(arg([1, 1]), 1.1071487177940904));
    });
    it('should return 0 if the given value is a number', () => {
      assert(eq(arg(1), 0));
    });
    it('should return NaN if the given value is not a complex.', () => {
      assert(isNaN(arg()));
    });
  });
  /**
   *
   */
  describe('asin', () => {
    it('should return an Array', () => {
      assert(asin([1, 0]) instanceof Array);
    });
    it('should return the inverse sine of the complex', () => {
      assert(equals(asin([1, 1]), [0.6662394324925153, 1.0612750619050355]));
    });
    it('should return the inverse sine complex of the given number', () => {
      assert(equals(asin(1), [Math.asin(1), 0]));
    });
    it('should return NaN Complex if the given value is not a complex.', () => {
      assert(NAN === asin());
    });
  });
  /**
   *
   */
  describe('asinh', () => {
    it('should return an Array', () => {
      assert(asinh([1, 0]) instanceof Array);
    });
    it('should return the hyperbolic inverse sine of the complex', () => {
      assert(equals(asinh([1, 1]), [1.0612750619050357, 0.6662394324925153]));
    });
    it('should return the hyperbolic inverse sine complex of the given number', () => {
      assert(equals(asinh(1), [Math.asinh(1), 0]));
    });
    it('should return NaN Complex if the given value is not a complex.', () => {
      assert(NAN === asinh());
    });
  });
  /**
   *
   */
  describe('atan', () => {
    it('should return an Array', () => {
      assert(atan([1, 0]) instanceof Array);
    });
    it('should return the inverse tangent of the complex', () => {
      assert(equals(atan([1, 1]), [1.0172219678978514, 0.40235947810852507]));
    });
    it('should return the inverse tangent complex of the given number', () => {
      assert(equals(atan(1), [Math.atan(1), 0]));
    });
    it('should return NaN Complex if the given value is not a complex.', () => {
      assert(NAN === atan());
    });
  });
  /**
   *
   */
  describe('atanh', () => {
    it('should return an Array', () => {
      assert(atanh([1, 0]) instanceof Array);
    });
    it('should return the hyperbolic inverse tangent of the complex', () => {
      assert(equals(atanh([1, 1]), [0.4023594781085251, 1.0172219678978514]));
    });
    it('should return the hyperbolic inverse tangent complex of the given number', () => {
      assert(equals(atanh(0.5), [Math.atanh(0.5), 0]));
    });
    it('should return NaN Complex if the given value is not a complex.', () => {
      assert(NAN === atanh());
    });
  });
  /**
   *
   */
  describe('ceil', () => {
    it('should return an Array', () => {
      assert(ceil([1, 0]) instanceof Array);
    });
    it('should return the ceiling of the complex', () => {
      assert(equals(ceil([0.5, 0.5]), [1, 1]));
